[include mainsail.cfg]
[include ./Demon_Klipper_Essentials_Unified/*.cfg]
[include ./Demon_User_Files/*.cfg]
[include ./KAMP_LiTE/*.cfg]
[exclude_object]
[include config_backup.cfg]
[include mechanical_level_tmc2209.cfg]
[include ./Demon_Klipper_Essentials_Unified/Other_Files/Demon_User_Files_Updater/Extract_Demon_User_Files_Mercury.cfg]
[include ./Demon_BTT_Eddy_Offset.cfg]
[include ./Coprint/*.cfg]
[include shell_command.cfg]


#====================================================================
# IDLE TIMEOUT
#====================================================================
[idle_timeout]
gcode:
    _DEMON_IDLE_TIMEOUT
timeout: 3600

########################################
# MCU'S
########################################

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_2F000C000C51313339373836-if00

# The MCU section only applies to the Eddy USB. For Eddy Coil you will use the MCU name of the toolboard that you connected the Eddy Coil to.
[mcu eddy]
serial: /dev/serial/by-id/usb-Klipper_rp2040_45474E621B02DA9A-if00 # This is the serial address of your eddy probe. This can be found by using the terminal of your klipper instance (typically through SSH) and using the command ```ls /dev/serial/by-id``` 
restart_method: command


[virtual_sdcard]
path: /home/mercury/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

# This file contains common pin mappings for the BIGTREETECH Octopus Max EZ.
# To use this config, the firmware should be compiled for the
# STM32H723 with a "128KiB bootloader" "25 MHz crystal"
# and "USB (on PA11/PA12)" or "CAN bus (on PD0/PD1)".

# See docs/Config_Reference.md for a description of parameters.

########################################
# STEPPERS
########################################

[stepper_x]
step_pin: PC13
dir_pin: !PC14
enable_pin: !PE6
microsteps: 32
rotation_distance: 40
endstop_pin: PF0
position_min: 0
position_endstop: 315
position_max: 315
homing_speed: 100

[stepper_y]
step_pin: PE4
dir_pin: PE5
enable_pin: !PE3
microsteps: 32
rotation_distance: 40
endstop_pin: PF2
position_endstop: 350
position_max: 350
homing_speed: 100

[stepper_z]
step_pin: PE1
dir_pin: PE0
enable_pin: !PE2
microsteps: 32
rotation_distance: 4
endstop_pin: probe:z_virtual_endstop
position_min: -5
position_max: 425
homing_speed: 10
homing_retract_dist: 5.0
homing_retract_speed: 10
second_homing_speed: 12


[stepper_z1]
step_pin: PB8
dir_pin: PB9
enable_pin: !PB7
microsteps: 32
rotation_distance: 4


########################################
# BED
########################################


[heater_bed]
heater_pin: PF5
sensor_pin: PB1 # TB
sensor_type: EPCOS 100K B57560G104F
control: pid
pid_Kp: 690.34
pid_Ki: 111.47
pid_Kd: 1068.83
min_temp: 0
max_temp: 140

########################################
# FANS
########################################


[controller_fan Case]
pin: PA4

########################################
# KINEMATICS
########################################

[printer]
kinematics: cartesian
max_velocity: 700            
max_accel: 5000             
max_accel_to_decel: 5000     
max_z_velocity: 5           
max_z_accel: 100             
square_corner_velocity: 5.0


########################################
# TMC2209 configuration
########################################

[tmc2209 stepper_x]
uart_pin: PG14
diag_pin: PF0
run_current: 0.800
hold_current: 0.400
stealthchop_threshold: 999999
interpolate: true

[tmc2209 stepper_y]
uart_pin: PG13
diag_pin: PF2
run_current: 0.800
hold_current: 0.400
stealthchop_threshold: 999999
interpolate: true

[tmc2209 stepper_z]
uart_pin: PG12
diag_pin: PF4
run_current: 0.800
hold_current: 0.400
stealthchop_threshold: 999999
interpolate: FALSE

[tmc2209 stepper_z1]
uart_pin: PG11
diag_pin: PF3
run_current: 0.800
hold_current: 0.400
stealthchop_threshold: 999999
interpolate: FALSE





########################################
# TMCAUTOTUNE
########################################

[autotune_tmc stepper_x]
motor: creality-42-34
tuning_goal: auto

[autotune_tmc stepper_y]
motor: creality-42-48
tuning_goal: auto

[autotune_tmc stepper_z]
motor: creality-42-34
tuning_goal: auto

[autotune_tmc stepper_z1]
motor: creality-42-34
tuning_goal: auto


########################################
# SCREW AND Z TILT
########################################

[screws_tilt_adjust]
speed: 200
horizontal_move_z: 5
screw_thread: CW-M3

screw2: 293,315
screw2_name: front_left

screw3: 1,315
screw3_name: front_right

screw4: 1,40
screw4_name: back_right

screw1: 293,40
screw1_name: back_left



[z_tilt]
z_positions: 
  378.4,180
  -18.4,180
points: 
  280,180
  0,180
speed: 250
horizontal_move_z: 5
retries: 15
retry_tolerance:0.0095

########################################
# PINS
########################################

[board_pins]
aliases:
    # FPC header, Aliases EXP1 & EXP2 for mini12864
    EXP1_1=PG2, EXP1_2=PD15,
    EXP1_3=PD14, EXP1_4=PD13,
    EXP1_5=PD12, EXP1_6=PD11,
    EXP1_7=PD10, EXP1_8=PE15,
    EXP1_9=<GND>, EXP1_10=<5V>,

    # EXP2 header
    EXP2_1=PE13, EXP2_2=PE12,
    EXP2_3=PG5, EXP2_4=PE11,
    EXP2_5=PG4, EXP2_6=PE14,
    EXP2_7=PG3, EXP2_8=<RST>,
    EXP2_9=<GND>, EXP2_10=<NC>

# See the sample-lcd.cfg file for definitions of common LCD displays

#====================================================================
# Axis Twist
#====================================================================

#[axis_twist_compensation]
#speed: 150
#   The speed (in mm/s) of non-probing moves during the calibration.
#   The default is 50.
#horizontal_move_z: 5
#   The height (in mm) that the head should be commanded to move to
#   just prior to starting a probe operation. The default is 5.
#calibrate_start_x: 50
#   Defines the minimum X coordinate of the calibration
#   This should be the X coordinate that positions the nozzle at the starting
#   calibration position. This parameter must be provided.
#calibrate_end_x: 300
#   Defines the maximum X coordinate of the calibration
#   This should be the X coordinate that positions the nozzle at the ending
#   calibration position. This parameter must be provided.
#calibrate_y: 175
#   Defines the Y coordinate of the calibration
#   This should be the Y coordinate that positions the nozzle during the
#   calibration process. This parameter must be provided and is recommended to
#   be near the center of the bed

########################################
# TEMP SENSORS
########################################

[temperature_sensor Raspberry_Pi]
sensor_type: temperature_host

[temperature_sensor mcu]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 90

#[temperature_sensor toolhead_mcu]
#sensor_type: temperature_mcu
#sensor_mcu: toolhead
#min_temp = 0
#max_temp = 100


[temperature_sensor btt_eddy_mcu]
